import React, { useState } from 'react';
import '../styles/EventForm.css';
import Navbar from "../components/Navbar.js";

function EventForm() {
    const [title, setTitle] = useState('');
    const [description, setDescription] = useState('');
    const [categories, setCategories] = useState('');
    const [date, setDate] = useState('');
    const [location, setLocation] = useState({ city: '', address: '' });
    const [faculties, setFaculties] = useState('');
    const [programs, setPrograms] = useState('');
    const [attendants, setAttendants] = useState('');
    const [comments, setComments] = useState('');
  
    const handleSubmit = (e) => {
      e.preventDefault();
  
      const newEvent = {
        title,
        description,
        categories: categories.split(',').map(category => category.trim()),
        date,
        location,
        faculties: faculties.split(',').map(faculty => ({ name: faculty.trim() })),
        programs: programs.split(',').map(program => ({ name: program.trim() })),
        attendants: attendants.split(',').map(attendant => ({ usuario: { username: attendant.trim() }, role: 'Asistente' })),
        comments: comments.split(',').map(comment => ({ text: comment.trim(), author: 'Anonymous' }))
      };
  
      fetch('http://localhost:5432/events/create', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newEvent),
      })
        .then(response => response.json())
        .then(data => {
          if (data.success) {
            alert('Event registered successfully');
            // Clear the form
            setTitle('');
            setDescription('');
            setCategories('');
            setDate('');
            setLocation({ city: '', address: '' });
            setFaculties('');
            setPrograms('');
            setAttendants('');
            setComments('');
          } else {
            console.error('Error registering event:', data.message);
          }
        })
        .catch(error => console.error('Error registering event:', error));
    };
  
    return (
      <div className="register-event-page">
        <Navbar />
        <div className="form-container">
          <h1>Register New Event</h1>
          <form onSubmit={handleSubmit}>
            <label>
              Title:
              <input type="text" value={title} onChange={(e) => setTitle(e.target.value)} required />
            </label>
            <label>
              Description:
              <textarea value={description} onChange={(e) => setDescription(e.target.value)} required></textarea>
            </label>
            <label>
              Categories (comma separated):
              <input type="text" value={categories} onChange={(e) => setCategories(e.target.value)} required />
            </label>
            <label>
              Date:
              <input type="date" value={date} onChange={(e) => setDate(e.target.value)} required />
            </label>
            <label>
              Location City:
              <input type="text" value={location.city} onChange={(e) => setLocation({ ...location, city: e.target.value })} required />
            </label>
            <label>
              Location Address:
              <input type="text" value={location.address} onChange={(e) => setLocation({ ...location, address: e.target.value })} required />
            </label>
            <label>
              Faculties (comma separated):
              <input type="text" value={faculties} onChange={(e) => setFaculties(e.target.value)} required />
            </label>
            <label>
              Programs (comma separated):
              <input type="text" value={programs} onChange={(e) => setPrograms(e.target.value)} required />
            </label>
            <label>
              Attendants (comma separated usernames):
              <input type="text" value={attendants} onChange={(e) => setAttendants(e.target.value)} required />
            </label>
            <label>
              Comments (comma separated):
              <input type="text" value={comments} onChange={(e) => setComments(e.target.value)} required />
            </label>
            <button type="submit">Register Event</button>
          </form>
        </div>
      </div>
    );
  }
  export default EventForm;
